import React from 'react';
import "./Home.css";

class Home extends React.Component{

  render() {
    return (
      <div className="container">
       <h1 className="home__logo">BLACKGREEN</h1>
       <span className="home__desc">버려진 플라스틱에 새로운 생명을 불어넣은 패션 기업들</span>
      </div>








    );
  }
} 

export default Home;
